static const char __pyx_k_Pan_and_tilt_the_camera_The_assu[] = "Pan and tilt the camera.\n\n        The assumption is that this function is called continuously,\n        for example while pressing a button in a GUI or HID.\n\n        >>> for _ in range(0, 100):\n        ...     time.sleep(0.05)\n        ...     receiver.ptz.pan_and_tilt(.5)\n\n        Arguments:\n            pan_speed (float): `1.0` (fastest left) \342\200\246 `0.0` (no movement) \342\200\246 `-1.0` (fastest right)\n            tilt_speed (float): `-1.0` (fastest downwards) \342\200\246 `0.0` (no movement) \342\200\246 `1.0` (fastest upwards)\n\n        .. Attention::\n            `1` is *to the left*, and `-1` *is to the right*!\n\n        .. versionadded:: 0.0.7\n        ";
